import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Iframe from 'react-iframe'


class App extends Component {

  constructor(props){
    super(props);
    this.state = {
      step: 0
    }
  }
  render(){
    if (this.state.step == 0) {
      return (
        <div className="App">
          <header className="App-header">
            <h2>
              STRING FREQUENCY
            </h2>
            <button onClick={()=>this.setState({step:1})}>begin</button>
          </header>
        </div>
      );
    }

    if (this.state.step == 1) {
      return (
        <div className="App">
          <header className="App-header">
            <h2>
              INTRODUCTION
            </h2>
            <p><i>Let’s begin by figuring out what “<b>frequency</b>” means in music:</i></p>
            <button onClick={()=>this.setState({step:2})}>next</button>
          </header>
        </div>
      );
    }

    if (this.state.step == 2) {
      return (
        <div className="App">
          <header className="App-header">
            <h2>
              STRING FREQUENCY
            </h2>
            <Iframe url="https://www.alexdemartos.es/wtuner/"
              width="550px"
              height="450px"
              id="myId"
              className="myClassname"
              allow="microphone"
              display="initial"
              position="relative"/>
          </header>
        </div>
      );
    }

  }
}

export default App;
